import React from 'react'
import Product from './Product'
import Button from './Button';
// importing the data
import items from "../data/store-items copy"

export default function ProductsGrid(props) {
    const productList = items.slice(0,props.limit).map((item)=>{
        return <Product key={item.name} name={item.name} price={item.price} img={item.image} />
    })
    const a = true;
    return (
        <section className='products'>
            {a? `<h2>Might also like</h2>`:null}
            <div className='products__grid'>
                {productList}
            </div>
            <Button content="more products"/>
        </section>
    )
}
